###### 目标检测模型
<font size=4>Faster R-CNN, Ren et al. CVPR 2016</font>

<img src="./image/FasterRCNN.png" width = "80%" />

<font size=5>
<ol>
<li> 一个单元格负责一个目标的分类和定位 </li>
<li>取定交并比的阈值，根据anchor box 与 Ground Truth的 交并比标定类别正负</li>
<li>传入RPN网络的样本数据被整理为anchor box（坐标）和每个anchor box是否有物体（二分类标签）。RPN网络将每个样本映射为一个概率值和四个坐标值，概率值反应这个anchor box有物体的概率，四个坐标值用于回归定义物体的位置。</li>
<li>最后将二分类和坐标回归的损失统一起来，作为RPN网络的目标训练。</li>    
</ol>
</font>
</script></section><section data-markdown><script type="text/template">
###### 目标检测模型
<img src="./image/YOLO2.png" width = "50%" />
<font size=4>Redmon et al. CVPR,2016</font>
<font size=4>

* 一个单元格只负责一个目标的分类和定位；输出一个五元组$(x,y,w,h,c)$，前四元标定预测框，$c$表示置信度，$c = P(object) \times IOU_{truth}^{pred}$

* $P(object)$ 表征预测框中含有目标的概率，$IOU_{truth}^{pred}$ 用来度量预测框的准确度，它是预测框与实际框的交并比。

#### 预处理
* 图像归一化
* 模型在Pascal VOC 2012上进行预训练
</script></section></section><section  data-markdown><script type="text/template">
#### 准确率的度量方式

查准率指训练得到的模型检测出的所有正例中真正例的比例：

$$P = \frac{TP}{TP + FP}$$

查全率指检测样本中所有正例被模型正确检测出来的比例：
$$R = \frac{TP}{TP + FN}$$

F1 是查准率与查全率的调和平均，其计算公式如下:

$$F1 = \frac{2 \times P \times T}{P + R}$$
</script></section><section ><section data-markdown><script type="text/template">

            function extend() {
              var target = {};
              for (var i = 0; i < arguments.length; i++) {
                var source = arguments[i];
                for (var key in source) {
                  if (source.hasOwnProperty(key)) {
                    target[key] = source[key];
                  }
                }
              }
              return target;
            }

            // Optional libraries used to extend on reveal.js
            var deps = [
              { src: './lib/js/classList.js', condition: function() { return !document.body.classList; } },
              { src: './plugin/markdown/marked.js', condition: function() { return !!document.querySelector('[data-markdown]'); } },
              { src: './plugin/markdown/markdown.js', condition: function() { return !!document.querySelector('[data-markdown]'); } },

            // default options to init reveal.js
            var defaultOptions = {
              controls: true,
              progress: true,
              history: true,
              center: true,
              transition: 'default', // none/fade/slide/convex/concave/zoom
              dependencies: deps
            };

            var queryOptions = Reveal.getQueryHash() || {};

            options = extend(defaultOptions, options, queryOptions);
